import React from 'react';
import './CampFilter.css';

const CampFilter = ({ show, onClose }) => {
    if (!show) {
        return null;
    }

    return (
        <div className="modal-overlay">
            <div className="modal-content">
                <button onClick={onClose}>Close</button>
                <div className="modal-body">
                    <div className="checkbox-container">
                        <label><input type="checkbox" /> 옵션 1</label>
                        <label><input type="checkbox" /> 옵션 2</label>
                        <label><input type="checkbox" /> 옵션 3</label>
                        <label><input type="checkbox" /> 옵션 4</label>
                    </div>
                    <div className="input-container">
                        <input type="text" placeholder="입력 1" />
                        <input type="text" placeholder="입력 2" />
                        <input type="text" placeholder="입력 3" />
                    </div>
                </div>
            </div>
        </div>
    );
}

export default CampFilter;
